import React from 'react';

const Header = () => {
  const headerStyle = {
    textAlign: 'center',
    marginTop: '1rem',
    marginBottom: '0.5rem',
  };

  return (
    <div id="header" style={headerStyle}>
      <header className="bg-hero-pattern bg-cover bg-center bg-no-repeat min-h-screen flex justify-center">
      <div className="bg-hero-pattern bg-cover bg-center bg-no-repeat min-h-screen flex items-start justify-center pt-10">
      <h1 className="text-stroke text-5xl font-bold border-b-4 border-blue-500">Your Text Here</h1>
    </div>
      </header>
    </div>
  );
};

export default Header;
